-- View structure for vi_all_bu_from_garydb
-- ----------------------------
DROP VIEW IF EXISTS `vi_all_bu_from_garydb`;
CREATE ALGORITHM=UNDEFINED DEFINER=`odin`@`%` SQL SECURITY DEFINER VIEW `vi_all_bu_from_garydb` AS select group_concat(`all_bu_from_garydb`.`pn` separator ',') AS `pn`,`all_bu_from_garydb`.`sap_bu` AS `sap_bu` from `all_bu_from_garydb` group by `all_bu_from_garydb`.`sap_bu` ;

-- ----------------------------
-- Procedure structure for ptest1
-- ----------------------------
DROP PROCEDURE IF EXISTS `ptest1`;
DELIMITER ;;
CREATE DEFINER=`odin`@`%` PROCEDURE `ptest1`()
BEGIN
	set @name = (SELECT max(table_name) as tb_name from `information_schema`.`TABLES` where table_name like 'a_result_test%');
	
	set @sqlStr = CONCAT('update ', @name, ' set priority=''3455'' ');
	PREPARE upsql from @sqlStr;
	EXECUTE upsql;
	DEALLOCATE PREPARE upsql;
end
;;
DELIMITER ;
